import React from "react";
import styled from "styled-components";


const TimeSlot = ({onClick, index, time, isPossible}) => {
    if (isPossible) {
        return (
            <button onClick={onClick} key={index} value={time}>possible</button>
        );
    } else {
        return (
            <button onClick={onClick} key={index} value={time}>impossible</button>
        );
    }

}

const ImpossibleSlot = ({onClick, index, time, isPossible}) => {
    return (
        <button onClick={onClick} key={index} value={time} isPossible={isPossible}>impossible</button>
    );
}

export default TimeSlot;
